core::ffi::CStr::as_ptr.doc:
Returns the inner pointer to this C string.

The returned pointer will be valid for as long as `self` is, and points
to a contiguous region of memory terminated with a 0 byte to represent
the end of the string.

The type of the returned pointer is
[`*const c_char`][crate::ffi::c_char], and whether it's
an alias for `*const i8` or `*const u8` is platform-specific.

**WARNING**

The returned pointer is read-only; writing to it (including passing it
to C code that writes to it) causes undefined behavior.

It is your responsibility to make sure that the underlying memory is not
freed too early. For example, the following code will cause undefined
behavior when `ptr` is used inside the `unsafe` block:

```no_run
# #![expect(dangling_pointers_from_temporaries)]
use std::ffi::{CStr, CString};

// üíÄ The meaning of this entire program is undefined,
// üíÄ and nothing about its behavior is guaranteed,
// üíÄ not even that its behavior resembles the code as written,
// üíÄ just because it contains a single instance of undefined behavior!

// üö® creates a dangling pointer to a temporary `CString`
// üö® that is deallocated at the end of the statement
let ptr = CString::new("Hi!".to_uppercase()).unwrap().as_ptr();

// without undefined behavior, you would expect that `ptr` equals:
dbg!(CStr::from_bytes_with_nul(b"HI!\0").unwrap());

// üôè Possibly the program behaved as expected so far,
// üôè and this just shows `ptr` is now garbage..., but
// üíÄ this violates `CStr::from_ptr`'s safety contract
// üíÄ leading to a dereference of a dangling pointer,
// üíÄ which is immediate undefined behavior.
// üíÄ *BOOM*, you're dead, your entire program has no meaning.
dbg!(unsafe { CStr::from_ptr(ptr) });
```

This happens because, the pointer returned by `as_ptr` does not carry any
lifetime information, and the `CString` is deallocated immediately after
the expression that it is part of has been evaluated.
To fix the problem, bind the `CString` to a local variable:

```
use std::ffi::{CStr, CString};

let c_str = CString::new("Hi!".to_uppercase()).unwrap();
let ptr = c_str.as_ptr();

assert_eq!(unsafe { CStr::from_ptr(ptr) }, c"HI!");
```

alloc_crate::vec::Vec::<T>::with_capacit.doc:
Constructs a new, empty `Vec<T>` with at least the specified capacity.

The vector will be able to hold at least `capacity` elements without
reallocating. This method is allowed to allocate for more elements than
`capacity`. If `capacity` is zero, the vector will not allocate.

It is important to note that although the returned vector has the
minimum *capacity* specified, the vector will have a zero *length*. For
an explanation of the difference between length and capacity, see
*[Capacity and reallocation]*.

If it is important to know the exact allocated capacity of a `Vec`,
always use the [`capacity`] method after construction.

For `Vec<T>` where `T` is a zero-sized type, there will be no allocation
and the capacity will always be `usize::MAX`.

[Capacity and reallocation]: #capacity-and-reallocation
[`capacity`]: Vec::capacity

# Panics

Panics if the new capacity exceeds `isize::MAX` _bytes_.

# Examples

```
let mut vec = Vec::with_capacity(10);

// The vector contains no items, even though it has capacity for more
assert_eq!(vec.len(), 0);
assert!(vec.capacity() >= 10);

// These are all done without reallocating...
for i in 0..10 {
    vec.push(i);
}
assert_eq!(vec.len(), 10);
assert!(vec.capacity() >= 10);

// ...but this may make the vector reallocate
vec.push(11);
assert_eq!(vec.len(), 11);
assert!(vec.capacity() >= 11);

// A vector of a zero-sized type will always over-allocate, since no
// allocation is necessary
let vec_units = Vec::<()>::with_capacity(10);
assert_eq!(vec_units.capacity(), usize::MAX);
```

alloc_crate::vec::Vec::<T, A>::as_mut_pt.doc:
Returns a raw mutable pointer to the vector's buffer, or a dangling
raw pointer valid for zero sized reads if the vector didn't allocate.

The caller must ensure that the vector outlives the pointer this
function returns, or else it will end up dangling.
Modifying the vector may cause its buffer to be reallocated,
which would also make any pointers to it invalid.

This method guarantees that for the purpose of the aliasing model, this method
does not materialize a reference to the underlying slice, and thus the returned pointer
will remain valid when mixed with other calls to [`as_ptr`], [`as_mut_ptr`],
and [`as_non_null`].
Note that calling other methods that materialize references to the slice,
or references to specific elements you are planning on accessing through this pointer,
may still invalidate this pointer.
See the second example below for how this guarantee can be used.

The method also guarantees that, as long as `T` is not zero-sized and the capacity is
nonzero, the pointer may be passed into [`dealloc`] with a layout of
`Layout::array::<T>(capacity)` in order to deallocate the backing memory. If this is done,
be careful not to run the destructor of the `Vec`, as dropping it will result in
double-frees. Wrapping the `Vec` in a [`ManuallyDrop`] is the typical way to achieve this.

# Examples

```
// Allocate vector big enough for 4 elements.
let size = 4;
let mut x: Vec<i32> = Vec::with_capacity(size);
let x_ptr = x.as_mut_ptr();

// Initialize elements via raw pointer writes, then set length.
unsafe {
    for i in 0..size {
        *x_ptr.add(i) = i as i32;
    }
    x.set_len(size);
}
assert_eq!(&*x, &[0, 1, 2, 3]);
```

Due to the aliasing guarantee, the following code is legal:

```rust
unsafe {
    let mut v = vec![0];
    let ptr1 = v.as_mut_ptr();
    ptr1.write(1);
    let ptr2 = v.as_mut_ptr();
    ptr2.write(2);
    // Notably, the write to `ptr2` did *not* invalidate `ptr1`:
    ptr1.write(3);
}
```

Deallocating a vector using [`Box`] (which uses [`dealloc`] internally):

```
use std::mem::{ManuallyDrop, MaybeUninit};

let mut v = ManuallyDrop::new(vec![0, 1, 2]);
let ptr = v.as_mut_ptr();
let capacity = v.capacity();
let slice_ptr: *mut [MaybeUninit<i32>] =
    std::ptr::slice_from_raw_parts_mut(ptr.cast(), capacity);
drop(unsafe { Box::from_raw(slice_ptr) });
```

