alloc_crate::vec::Vec::<T, A>::capacity.doc:
Returns the total number of elements the vector can hold without
reallocating.

# Examples

```
let mut vec: Vec<i32> = Vec::with_capacity(10);
vec.push(42);
assert!(vec.capacity() >= 10);
```

A vector with zero-sized elements will always have a capacity of usize::MAX:

```
#[derive(Clone)]
struct ZeroSized;

fn main() {
    assert_eq!(std::mem::size_of::<ZeroSized>(), 0);
    let v = vec![ZeroSized; 0];
    assert_eq!(v.capacity(), usize::MAX);
}
```

core::ops::Try::branch.doc:
Used in `?` to decide whether the operator should produce a value
(because this returned [`ControlFlow::Continue`])
or propagate a value back to the caller
(because this returned [`ControlFlow::Break`]).

# Examples

```
#![feature(try_trait_v2)]
use std::ops::{ControlFlow, Try};

assert_eq!(Ok::<_, String>(3).branch(), ControlFlow::Continue(3));
assert_eq!(Err::<String, _>(3).branch(), ControlFlow::Break(Err(3)));

assert_eq!(Some(3).branch(), ControlFlow::Continue(3));
assert_eq!(None::<String>.branch(), ControlFlow::Break(None));

assert_eq!(ControlFlow::<String, _>::Continue(3).branch(), ControlFlow::Continue(3));
assert_eq!(
    ControlFlow::<_, String>::Break(3).branch(),
    ControlFlow::Break(ControlFlow::Break(3)),
);
```

alloc_crate::vec::Vec::<T, A>::set_len.doc:
Forces the length of the vector to `new_len`.

This is a low-level operation that maintains none of the normal
invariants of the type. Normally changing the length of a vector
is done using one of the safe operations instead, such as
[`truncate`], [`resize`], [`extend`], or [`clear`].

[`truncate`]: Vec::truncate
[`resize`]: Vec::resize
[`extend`]: Extend::extend
[`clear`]: Vec::clear

# Safety

- `new_len` must be less than or equal to [`capacity()`].
- The elements at `old_len..new_len` must be initialized.

[`capacity()`]: Vec::capacity

# Examples

See [`spare_capacity_mut()`] for an example with safe
initialization of capacity elements and use of this method.

`set_len()` can be useful for situations in which the vector
is serving as a buffer for other code, particularly over FFI:

```no_run
# #![allow(dead_code)]
# // This is just a minimal skeleton for the doc example;
# // don't use this as a starting point for a real library.
# pub struct StreamWrapper { strm: *mut std::ffi::c_void }
# const Z_OK: i32 = 0;
# unsafe extern "C" {
#     fn deflateGetDictionary(
#         strm: *mut std::ffi::c_void,
#         dictionary: *mut u8,
#         dictLength: *mut usize,
#     ) -> i32;
# }
# impl StreamWrapper {
pub fn get_dictionary(&self) -> Option<Vec<u8>> {
    // Per the FFI method's docs, "32768 bytes is always enough".
    let mut dict = Vec::with_capacity(32_768);
    let mut dict_length = 0;
    // SAFETY: When `deflateGetDictionary` returns `Z_OK`, it holds that:
    // 1. `dict_length` elements were initialized.
    // 2. `dict_length` <= the capacity (32_768)
    // which makes `set_len` safe to call.
    unsafe {
        // Make the FFI call...
        let r = deflateGetDictionary(self.strm, dict.as_mut_ptr(), &mut dict_length);
        if r == Z_OK {
            // ...and update the length to what was initialized.
            dict.set_len(dict_length);
            Some(dict)
        } else {
            None
        }
    }
}
# }
```

While the following example is sound, there is a memory leak since
the inner vectors were not freed prior to the `set_len` call:

```
let mut vec = vec![vec![1, 0, 0],
                   vec![0, 1, 0],
                   vec![0, 0, 1]];
// SAFETY:
// 1. `old_len..0` is empty so no elements need to be initialized.
// 2. `0 <= capacity` always holds whatever `capacity` is.
unsafe {
    vec.set_len(0);
#   // FIXME(https://github.com/rust-lang/miri/issues/3670):
#   // use -Zmiri-disable-leak-check instead of unleaking in tests meant to leak.
#   vec.set_len(3);
}
```

Normally, here, one would use [`clear`] instead to correctly drop
the contents and thus not leak memory.

